(257, 1, '2023-08-22 18:34:46', '2023-08-22 18:34:46', 'Kolkata: West Bengal Chief Minister Mamata Banerjee on Tuesday launched an onslaught on the BJP-ruled Centre, asserting that while Prime Minister Narendra Modi speaks of taking along everybody, he \'attacks\' opposition-ruled states, and added for good measure that her party members are being targeted by central agencies \'without reason\'.\r\n\r\nBanerjee, who was speaking at a meeting with organisers of Durga Puja celebrations in the state, also announced an increase in grant-in-aid that the state government gives to Puja committees to Rs 70,000.\r\n\r\n\"Our people are being targeted by central agencies without reason. The PM speaks of taking along everybody, but targets opposition-ruled states. Even the smallest of incidents like an ant bite is being probed by the ED and CBI,\" the TMC supremo said.', 'Mamata Banerjee Slams ED, CBI, Says \'Even Small Incidents Like Ant Bite Being Probed\'', '', 'publish', 'open', 'open', '', 'mamata-banerjee-slams-ed-cbi-says-even-small-incidents-like-ant-bite-being-probed', '', '', '2023-08-24 04:30:26', '2023-08-24 04:30:26', '', 0, 'https://starnewsmedia.in/?p=257', 0, 'post', '', 0),
